/// <summary>
/// Updating the bank code lookpups from the W0X fields.
/// </summary>
protected void updateBankCodelookupValues()
{
    if(gSKS_EFT_Bank.W01)
    {
        this.updateBankFields('TestFileIndicator', gSKS_EFT_Bank.W01, true);
    }

    if(gSKS_EFT_Bank.W02)
    {
        this.updateBankFields('OffsetOverride', gSKS_EFT_Bank.W02, true);
    }
}

/// <summary>
/// Updating vednor code lookpus from BE0X and Legacu code loookups
/// </summary>
protected void updateVendorCodelookupValues()
{
    if(gSKS_EFT_VendorPaym.BE01)
    {
        this.updateVendorFields('BuildngSocietyRollNum', gSKS_EFT_VendorPaym.BE01);
    }
    if(gSKS_EFT_VendorPaym.WIntBankQualifier)
    {
        this.updateVendorFields('IntBankCodeQual', gSKS_EFT_VendorPaym.WIntBankQualifier, true);
    }
}
